--##########################################
--*/
WHENEVER SQLERROR EXIT SQL.SQLCODE;
SET SERVEROUTPUT ON; 
SET DEFINE OFF;


DECLARE
    V_MSQL VARCHAR2(32000 CHAR); -- Sentencia a ejecutar     
    V_ESQUEMA VARCHAR2(25 CHAR):= 'REM01'; -- Configuracion Esquema
    V_ESQUEMA_M VARCHAR2(25 CHAR):= 'REMMASTER'; -- Configuracion Esquema Master
    V_SQL VARCHAR2(4000 CHAR); -- Vble. para consulta que valida la existencia de una tabla.
    V_NUM_TABLAS NUMBER(16); -- Vble. para validar la existencia de una tabla.   
    ERR_NUM NUMBER(25);  -- Vble. auxiliar para registrar errores en el script.
    ERR_MSG VARCHAR2(1024 CHAR); -- Vble. auxiliar para registrar errores en el script.
    CONTADOR_1 NUMBER(16);
    CONTADOR_2 NUMBER(16);
 
BEGIN   

DBMS_OUTPUT.PUT_LINE('[INICIO] PROCESO Carga masiva CEE');

EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM ALL_TABLES WHERE TABLE_NAME = ''TMP_CEE'' AND OWNER = ''REM01''' INTO V_NUM_TABLAS;

IF V_NUM_TABLAS = 1 THEN

  EXECUTE IMMEDIATE 'TRUNCATE TABLE REM01.TMP_CEE';

ELSE

  EXECUTE IMMEDIATE 'CREATE TABLE REM01.TMP_CEE (
  ACT_NUM_ACTIVO  NUMBER(16,0),
  ADO_FECHA_EMISION DATE,
  ADO_FECHA_CADUCIDAD DATE,
  DD_TCE_DESCRIPCION  VARCHAR2(100 CHAR),
  ACT_ID  NUMBER(16,0),
  DD_TCE_ID NUMBER(16,0)
  )';

END IF;


MERGE INTO REM01.TMP_CEE T1 
USING REM01.ACT_ACTIVO T2
ON (T1.ACT_NUM_ACTIVO = T2.ACT_NUM_ACTIVO)
WHEN MATCHED THEN UPDATE
SET T1.ACT_ID = T2.ACT_ID;

EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM REM01.TMP_CEE' INTO CONTADOR_1;
EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM REM01.TMP_CEE WHERE ACT_ID IS NOT NULL' INTO CONTADOR_2;

DBMS_OUTPUT.PUT_LINE('Se procesar√°n '||CONTADOR_2||' filas de las '||CONTADOR_1||' filas enviadas en el Excel');

MERGE INTO REM01.TMP_CEE T1 
USING REM01.DD_TCE_TIPO_CALIF_ENERGETICA T2
ON (T1.DD_TCE_DESCRIPCION = T2.DD_TCE_DESCRIPCION)
WHEN MATCHED THEN UPDATE
SET T1.DD_TCE_ID = T2.DD_TCE_ID;

MERGE INTO REM01.ACT_ADO_ADMISION_DOCUMENTO T1 
USING (SELECT T1.ACT_ID, T1.ADO_FECHA_EMISION, T1.ADO_FECHA_CADUCIDAD, T4.DD_TCE_ID, T5.CFD_ID
    FROM REM01.TMP_CEE T1
    JOIN REM01.ACT_ACTIVO T2 ON T1.ACT_ID = T2.ACT_ID
    JOIN REM01.DD_TPD_TIPO_DOCUMENTO T3 ON T3.DD_TPD_CODIGO = '11'
    JOIN REM01.DD_TCE_TIPO_CALIF_ENERGETICA T4 ON T4.DD_TCE_DESCRIPCION = T1.DD_TCE_DESCRIPCION
    JOIN REM01.ACT_CFD_CONFIG_DOCUMENTO T5 ON T5.DD_TPD_ID = T3.DD_TPD_ID AND T2.DD_TPA_ID = T5.DD_TPA_ID) T2
ON (T1.ACT_ID = T2.ACT_ID AND T1.CFD_ID = T2.CFD_ID)
WHEN MATCHED THEN UPDATE SET 
    T1.ADO_FECHA_EMISION = T2.ADO_FECHA_EMISION, T1.ADO_FECHA_OBTENCION = T2.ADO_FECHA_EMISION
    , T1.ADO_FECHA_CADUCIDAD = T2.ADO_FECHA_CADUCIDAD, T1.USUARIOMODIFICAR = 'HREOS-3360'
    , T1.FECHAMODIFICAR = SYSDATE
WHEN NOT MATCHED THEN INSERT (ADO_ID, ACT_ID, CFD_ID, ADO_FECHA_EMISION, ADO_FECHA_OBTENCION, ADO_FECHA_CADUCIDAD
    , DD_TCE_ID, USUARIOCREAR, FECHACREAR)
    VALUES (REM01.S_ACT_ADO_ADMISION_DOCUMENTO.NEXTVAL, T2.ACT_ID, T2.CFD_ID, T2.ADO_FECHA_EMISION, T2.ADO_FECHA_EMISION, T2.ADO_FECHA_CADUCIDAD
        , T2.DD_TCE_ID, 'HREOS-3360', SYSDATE);
EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM REM01.ACT_ADO_ADMISION_DOCUMENTO WHERE USUARIOMODIFICAR = ''HREOS-3360''' INTO CONTADOR_1;
DBMS_OUTPUT.PUT_LINE('Se han actualizado '||CONTADOR_1||' filas en la tabla ACT_ADO_ADMISION_DOCUMENTO');
EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM REM01.ACT_ADO_ADMISION_DOCUMENTO WHERE USUARIOCREAR = ''HREOS-3360''' INTO CONTADOR_2;
DBMS_OUTPUT.PUT_LINE('Se han creado '||CONTADOR_2||' filas en la tabla ACT_ADO_ADMISION_DOCUMENTO');
    
 DBMS_OUTPUT.PUT_LINE('[FIN]: PROCESO Carga masiva CEE.');

COMMIT;    

   
EXCEPTION
     WHEN OTHERS THEN
          err_num := SQLCODE;
          err_msg := SQLERRM;

          DBMS_OUTPUT.put_line('[ERROR] Se ha producido un error en la ejecuci√≥n:'||TO_CHAR(err_num));
          DBMS_OUTPUT.put_line('-----------------------------------------------------------'); 
          DBMS_OUTPUT.put_line(err_msg);

          ROLLBACK;
          RAISE;          

END;
/

EXIT;


